import React from "react";
import NavBar from "./NavBar";
import Banner from "./Banner";
import { Box, Typography, Badge, Button, styled } from "@mui/material";
const Component = styled(Box)`
  color:
  padding: 20px 10px;

`;

function Home(props) {
  return (
    <>
      <NavBar />
   <Component>
   <Banner />
   </Component>
      
    </>
  );
}

export default Home;
